\n<modification>\n    <code>Clean Maintenance Mode Page</code>\n    <name>Clean Maintenance Mode Page</name>\n    <version>1.0</version>\n	<link>http://www.harnishdesign.net</link>\n    <author>Harnish Design</author>\n  <file path=\"catalog/view/theme/*/template/common/maintenance.twig\">\n  <operation error=\"skip\">\n			<search><![CDATA[\n			{{ header }}\n			]]></search>\n			<add position=\"replace\" offset=\"6\">\n			<![CDATA[<!DOCTYPE html>\n<html dir=\"{{ direction }}\" lang=\"{{ lang }}\">\n<head>\n<meta charset=\"UTF-8\" />\n<meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\" />\n<meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n<title>{{ title }}</title>\n<base href=\"{{ base }}\" />\n{% if description %}\n<meta name=\"description\" content=\"{{ description }}\" />\n{% endif %}\n{% if keywords %}\n<meta name=\"keywords\" content=\"{{ keywords }}\" />\n{% endif %}\n{% for link in links %}\n<link href=\"{{ link.href }}\" rel=\"{{ link.rel }}\" />\n{% endfor %}\n<script src=\"catalog/view/javascript/jquery/jquery-2.1.1.min.js\" type=\"text/javascript\"></script>\n<link href=\"catalog/view/javascript/bootstrap/css/bootstrap.min.css\" rel=\"stylesheet\" media=\"screen\" />\n<script src=\"catalog/view/javascript/bootstrap/js/bootstrap.min.js\" type=\"text/javascript\"></script>\n<link href=\"catalog/view/javascript/font-awesome/css/font-awesome.min.css\" rel=\"stylesheet\" type=\"text/css\" />\n<link href=\'//fonts.googleapis.com/css?family=Poppins\' rel=\'stylesheet\' type=\'text/css\'>\n{% for script in scripts %}\n<script src=\"{{ script }}\" type=\"text/javascript\"></script>\n{% endfor %}\n</head>\n<style>\nbody{background:#4843d2; color:#fff; font-family:Poppins, Arial, Helvetica, sans-serif;}\nh1{font-weight:bold; line-height:normal;}\n.icon-maintenance{position:relative; margin-top:60px; display:inline-block;}\n.icon-maintenance1{font-size:180px;}\n.icon-maintenance2{position:absolute; top:19px; right:-18px;}\n.icon-maintenance3{position:absolute; top:17px; right:-85px;}\n@media (max-width: 767px) {\n	h1{font-size:22px;}\n	.icon-maintenance{margin-top:20px;}\n}\n</style>\n<body>\n<div id=\"common-maintenance\" class=\"container\">\n  <div class=\"row\">\n    <div class=\"col-sm-12 text-center\">\n    <div class=\"icon-maintenance\">\n    <i class=\"fa fa-wrench icon-maintenance1\"></i>\n    <i class=\"fa fa-cog fa-spin fa-3x fa-fw icon-maintenance2\"></i>\n    <i class=\"fa fa-cog fa-spin fa-5x fa-fw icon-maintenance3\"></i>\n    </div>\n    </div>\n    <div class=\"col-sm-12\">{{ message }}</div>\n  </div>\n</div>\n</body>\n</html>\n]]>\n</add>\n</operation>\n</file>\n<file path=\"catalog/controller/common/maintenance.php\">\n    <operation>\n      <search>\n        <![CDATA[\n		$data[\'breadcrumbs\'] = array();\n		]]>\n      </search>\n      <add position=\"before\">\n        <![CDATA[\n		if ($this->request->server[\'HTTPS\']) {\n			$server = $this->config->get(\'config_ssl\');\n		} else {\n			$server = $this->config->get(\'config_url\');\n		}\n		if (is_file(DIR_IMAGE . $this->config->get(\'config_icon\'))) {\n			$this->document->addLink($server . \'image/\' . $this->config->get(\'config_icon\'), \'icon\');\n		}\n		$data[\'title\'] = $this->document->getTitle();\n		$data[\'base\'] = $server;\n		$data[\'description\'] = $this->document->getDescription();\n		$data[\'keywords\'] = $this->document->getKeywords();\n		$data[\'links\'] = $this->document->getLinks();\n		$data[\'styles\'] = $this->document->getStyles();\n		$data[\'scripts\'] = $this->document->getScripts(\'header\');\n		$data[\'lang\'] = $this->language->get(\'code\');\n		$data[\'direction\'] = $this->language->get(\'direction\');\n		$data[\'name\'] = $this->config->get(\'config_name\');\n		]]>\n      </add>\n    </operation>\n  </file>\n</modification>","1","2019-03-14 14:03:48");
