\n<modification>\n  <name><b>Toggle Admin Menu Left</b></name>\n	<code>Toggle Admin Menu Left</code>\n	<version>1.0</version>\n	<author>Lab129.com</author>\n	<link>http://lab129.com/</link>\n	<file path=\"admin/controller/common/header.php\">\n	  	<operation>\n		<search><![CDATA[return $this->load->view(\'common/header\', $data);]]></search>\n			<add position=\"before\"><![CDATA[\n\n			 if (is_file(DIR_IMAGE . $this->config->get(\'config_logo\'))) {\n			$data[\'logo\'] = HTTPS_CATALOG . \'image/\'. $this->config->get(\'config_logo\');\n		} else {\n			$data[\'logo\'] = \'\';\n		}\n			]]></add>\n		</operation>\n	</file>\n 	<file path=\"admin/view/template/common/header.twig\">\n	  	<operation>\n		<search><![CDATA[<img src=\"view/image/logo.png\" alt=\"{{ heading_title }}\" title=\"{{ heading_title }}\" />]]></search>\n			<add position=\"replace\"><![CDATA[\n           <img src=\"{{ logo }}\" class=\"img-responsive\" />\n			]]></add>\n		</operation>\n		<operation>\n		<search><![CDATA[<a href=\"#\" id=\"button-menu\" class=\"hidden-md hidden-lg\"><span class=\"fa fa-bars\"></span></a>]]></search>\n			<add position=\"before\"><![CDATA[\n           <a id=\"button-menu\" class=\"visible-md visible-lg hidden-sm\"><span class=\"fa fa-bars\"></span></a>\n			]]></add>\n		</operation>\n	</file>\n  <file path=\"admin/view/template/common/footer.twig\">\n    <operation>\n        <search><![CDATA[<footer id=\"footer\">]]></search>\n        <add position=\"before\"><![CDATA[\n        	<style>\n        		.unactive {display: none ;} \n        		.activeMN {display: block !important;}\n        		.mnsOFF {margin-left: 0px !important;}\n				.mnsON {margin-left: 235px !important;}\n				.navbar-brand {padding: 0px !important;height: 50px;}\n        	</style>\n<script type=\"text/javascript\">\n	if (localStorage.getItem(\'column-left\') != \'active\') {$(\'#column-left\').hide();$(\'#content\').addClass(\'mnsOFF\');$(\'#content\').removeClass(\'mnsON\');} \n	if (localStorage.getItem(\'column-left\') == \'active\') {$(\'#column-left\').show();$(\'#content\').addClass(\'mnsON\');$(\'#content\').removeClass(\'mnsOFF\');}\n	$(\'#button-menu\').on(\'click\', function() {if ($(\'#column-left\').hasClass(\'active\')){$(\'#column-left\').hide();$(\'#content\').addClass(\'mnsOFF\');$(\'#content\').removeClass(\'mnsON\');localStorage.setItem(\'column-left\', \'active\');}else{$(\'#column-left\').show();$(\'#content\').removeClass(\'mnsOFF\');localStorage.setItem(\'column-left\', \'\');}});\n</script>\n		]]></add>\n		</operation>\n	</file>\n  </modification> ","1","2019-03-14 14:28:43");



