INSERT INTO oc_information_description VALUES("4","1","About Us","&lt;p&gt;&lt;b&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;*** Welcome to Kasturi Collection ***&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;&lt;p align=&quot;justify&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;?Kasturi Collection started in 2018 with an aim of delivering the Clothing needs using an Online Platform.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p align=&quot;justify&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-size: 14px;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;Customers can shop using KasturiCollection Android App, website, and pick from a large collection of sarees, kurta kurtis, dress material, dresses, tops, jeans, jeggings, leggings, lingerie.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p align=&quot;justify&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-size: 14px;&quot;&gt;We keep enhancing our technology and product assortment to ensure that Kasturi Collection is the most delightful shopping experience for everyone.&lt;/span&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-size: 14px;&quot;&gt;We assort the collection from the best brands, trends, colours, fabrics, patterns.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;h3 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(68, 68, 68); margin-top: 20px; margin-bottom: 10px; font-size: 21px;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;b&gt;Our Address :&amp;nbsp;&amp;nbsp;&lt;/b&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Near Bhairavnath Bhel,Narhegoan,Pune-411041&lt;/span&gt;&lt;/font&gt;&lt;/h3&gt;&lt;h3 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(68, 68, 68); margin-top: 20px; margin-bottom: 10px; font-size: 21px;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;b&gt;Contact No&amp;nbsp; &amp;nbsp; :&lt;/b&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;7058756668&lt;/span&gt;&lt;/font&gt;&lt;/h3&gt;&lt;p style=&quot;margin-top: 20px; margin-bottom: 10px; color: rgb(68, 68, 68); font-size: 21px;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;b&gt;Email Id&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;:&lt;/b&gt;&amp;nbsp;info@kasturicollection.com&amp;nbsp;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: PTSans-Regular; font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;INSERT INTO oc_information_description VALUES("5","1","Terms &amp; Conditions","&lt;p align=&quot;justify&quot; style=&quot;margin-bottom: 20px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 1.6; color: rgb(51, 51, 51);&quot;&gt;&lt;strong style=&quot;margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Use of the Website&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;By accessing the website, you warrant and represent to the website owner that you are legally entitled to do so and to make use of information made available via the website.&lt;/span&gt;&lt;/p&gt;&lt;p align=&quot;justify&quot; style=&quot;margin-bottom: 20px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 1.6; color: rgb(51, 51, 51);&quot;&gt;&lt;strong style=&quot;margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Trademarks&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;The trademarks, names, logos