fy&quot; style=&quot;margin-bottom: 20px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 1.6; color: rgb(51, 51, 51);&quot;&gt;&lt;strong style=&quot;margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Severability&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Any provision of any relevant terms and conditions, policies and notices, which is or becomes unenforceable in any jurisdiction, whether due to being void, invalidity, illegality, unlawfulness or for any reason whatever, shall, in such jurisdiction only and only to the extent that it is so unenforceable, be treated as void and the remaining provisions of any relevant terms and conditions, policies and notices shall remain in full force and effect.&lt;/span&gt;&lt;/p&gt;&lt;p align=&quot;justify&quot; style=&quot;margin-bottom: 20px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 1.6; color: rgb(51, 51, 51);&quot;&gt;&lt;strong style=&quot;margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Applicable laws &lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Use of this website shall in all respects be governed by the laws of the state of Maharashtra, regardless of the laws that might be applicable under principles of conflicts of law. The parties agree that the Maharashtra courts located in India, Maharashtra, shall have exclusive jurisdiction over all controversies arising under this agreement and agree that venue is proper in those courts.&lt;/span&gt;&lt;/p&gt;INSERT INTO oc_information_description VALUES("3","1","Privacy Policy","&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;This document is an electronic record in terms of Information Technology Act, 2000 and rules there under as applicable and the provisions pertaining to electronic records in various statutes as amended by the Information Technology Act, 2000. This electronic record is generated by a computer system and does not require any physical or digital signatures to make the terms of this policy binding.&lt;/span&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: 14px;&quot;&gt;At KasturiCollection.com data protection is a matter of trust and your privacy is very important to us. We use your personal information only in the manner set out in this Privacy Policy. Please read this privacy policy to learn more about our information gathering and dissemination practices.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: 14px;&quot;&gt;The privacy practices of this statement apply to our services available under the domain and sub-domains of KasturiCollection.com (the &quot;Site&quot;) and apply generally to our parent, affiliates, subsidiaries or joint venture websites. By visiting the Site you agree to be bound by the terms and conditions of this Privacy Policy.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: 14px;&quot;&gt;This Privacy Policy explains how&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: Verdana; font-size: 14px;&quot;&gt;KasturiCollection&lt;/span&gt;&lt;span style=&quot;font-family: Verdana; font-size: 14px;&quot;&gt;.com gathers personal information, classified as mandatory or optional as part of the normal operation of our services; and uses, discloses and protects such information through the Site. This detailed privacy policy enables you to take informed decisions in dealings with us. Our parent, subsidiaries and joint ventures operate under similar privacy practices subject to the requirements of applicable law.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: 14px;&quot;&gt;By registering with&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: Verdana; font-size: 14px;&quot;&gt;KasturiCollection&lt;/span&gt;&lt;span style=&quot;font-family: Verdana; font-size: 14px;&quot;&gt;.com, you acknowledge your acceptance of the terms of this Privacy Policy, expressly consent to our use and disclosure of your personal information in accordance with this Privacy Policy and that any personal information provided by you through KasturiCollection.com is provided under a lawful contract. This Privacy Policy is incorporated into and subject to the terms of the User Agreement. Note: Our privacy policy is subject to change at any time without notice. To make sure you are aware of any changes, please review this policy periodically.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;b&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Your Privacy&lt;/span&gt;&lt;/font&gt;&lt;/b&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;At KasturiCollection.com, we are extremely proud of our commitment to protect your privacy. We value your trust in us. We work hard to earn your confidence so that you can enthusiastically use our services and recommend your friends and family to participate in dealing with us. Please read the following policy to understand how your personal information will be treated as you make full use of our Site.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;b&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;KasturiCollection.com Privacy Assurance&lt;/span&gt;&lt;/font&gt;&lt;/b&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;KasturiCollection.com promises that we will not sell or rent your personal information to third parties for their marketing purposes without your explicit consent. From time to time we may reveal general statistical information about our Web site and visitors, such as number of visitors, number and type of goods and services purchased, etc. Your trust and confidence are our highest priority.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;b&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Information that KasturiCollection.com collects&lt;/span&gt;&lt;/font&gt;&lt;/b&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;When you use our Site, we collect and store your personal information. We gather your personal information in order to record, support and facilitate your participation in the activities you select, track your preferences, to provide you with a customized Site experience, to notify you of any updated information and new activities and other related functions offered by&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;span style=&quot;font-family: Verdana; font-size: 14px;&quot;&gt;KasturiCollection&lt;/span&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;.com, keep you informed about latest content available on the Site, special offers, and other products and services of KasturiCollection, to assist you with customer service or technical support issues, to follow up with you after your visit, to otherwise support your relationship with KasturiCollection or to prevent fraud and unlawful use. For the aforesaid purpose, we only collect such personal information that we consider relevant to understand you or your interests.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: 14px;&quot;&gt;In general, you can visit the Site without having to provide your personal information during which time you remain anonymous and at no time can we identify you unless you have an account on the Site and log on with your user name and password. Once you provide your personal information, you are no more anonymous to us. To fully use our Site, you will need to register using our online registration form, where you may be required to provide us with your name, date of birth, contact number, email id, user id, password, residence / place of business information, billing information, shipping information, bank account details and other personal information as indicated on the forms throughout the Site. Further the fields are marked as mandatory or optional. You always have the option to not provide information by choosing not to use a particular service or feature on the Site. You may provide us with your KasturiCollection.com registered user ID. We may automatically track certain information about you based upon your behavior on our site. We use this information to analyze trends, administer the site, track a users movement and gather broad demographic information, to better understand, protect and serve our users. This information is compiled and analyzed on an aggregated basis. This information may include the URL that you just came from (whether this URL is on our site or not), which URL you next go to (whether this URL is on our site or not), your computer browser information, and your IP address.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: 14px;&quot;&gt;We use data collection devices such as &quot;cookies&quot; on certain pages of the Site to help analyze our web page flow, measure promotional effectiveness, and promote trust and safety. &quot;Cookies&quot; are small files which identify your computer to our server as a unique user when you visit certain pages on the Site and they are stored by your Internet browser on your computer\'s hard drive. We offer certain features that are only available through the use of a &quot;cookie&quot;. We also use cookies to allow you to enter your password less frequently during a session. Cookies can also help us provide information that is targeted to your interests. Most cookies are &quot;session cookies,&quot; meaning that they are automatically deleted from your hard drive at the end of a session. You are always free to decline our cookies if your browser permits, although in that case you may not be able to use full functionality of the Site. We only use cookies for your convenience in using the Site and not for obtaining or using any other information about you. We do not control the use of cookies by third parties.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: 14px;&quot;&gt;If you choose to buy or sell on the Site, we collect information about your buying and selling behavior.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: 14px;&quot;&gt;If you are a seller, we also collect some additional information, such as a billing address, banking information other payment instrument details and tracking information from cheques or money orders.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: 14px;&quot;&gt;If you choose to post messages on our message boards, chat rooms or other message areas or leave feedback for other users, we retain this information as necessary to resolve disputes, provide customer support and troubleshoot problems as permitted by law.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: 14px;&quot;&gt;If you send us personal correspondence, such as emails or letters, or if other users or third parties send us correspondence about your activities or postings on the Site, we may collect such information into a file specific to you.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: 14px;&quot;&gt;If you register for the Site on another web site or use a web site providing a service for KasturiCollection or a web site that helps facilitates your activity on the Site, that web site may provide personal information about you and your transactions back to us.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;b&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Our use of your information&lt;/span&gt;&lt;/font&gt;&lt;/b&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;We use your personal information to facilitate the services you request. We do not sell, rent, trade or exchange any personally-identifying information of our Users. We may provide your collected information to our affiliates and service providers under contract (such as customer care, data analytics) to support the operation of the Website and our services. To the extent we use your personal information to market to you, we will provide you the ability to opt-out of such uses. We use your personal information to: resolve disputes; troubleshoot problems; help promote safe trading; collect fees owed; measure consumer interest in the services provided by us, inform you about online and offline offers, products, services, and updates; customize your experience; detect and protect us against error, fraud and other criminal activity; enforce our User Agreement, and in general to improve the user experience and make it comparable to other e-commerce websites; and as otherwise described to you at the time of collection. In our efforts to continually improve our product and service offerings, we collect and analyze demographic, profile and usage data about our users\' activity on our Site.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;We use your personal information to improve our platform, improve the Site\'s content and product offerings, prevent or detect fraud or abuses of our website and tailor it to meet your needs, so as to provide you with a smooth, efficient, safe and customized experience while using the Site.&lt;/span&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;We may also use your personal information to display contents and services that are targeted to your interests. By accepting the User Agreement and Privacy Policy, you expressly agree to receive this information. If you do not wish to receive these communications, we encourage you to opt out of the receipt of certain communications in your profile under My Account or by clicking unsubscribe any email communication. You may make changes to your profile at any time.&lt;/span&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Our Disclosure of your information&lt;/span&gt;&lt;/b&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Your personal information is an important part of our business and we are not in the business of selling it to others. KasturiCollection.com shares your personal information only to categories of persons that are either subject to this Privacy Policy or follow practices at least as protective as those described in this Privacy Policy as more particularly described below:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;b style=&quot;font-family: Verdana;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Legal Requests&lt;/span&gt;&lt;/b&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;We cooperate with law enforcement and regulatory inquiries, as well as other third parties to enforce laws, such as: intellectual property rights, fraud and other rights, to help protect you and the community from bad actors. Therefore, in response to a verified request by law enforcement or other government officials relating to a criminal investigation or alleged illegal activity, we may (and you authorize us to) disclose some of your personal information as is reasonably necessary to respond to subpoenas, court orders, or other legal process. We may disclose personal information to law enforcement offices, third party rights owners, or others in the good faith belief that such disclosure is reasonably necessary to: enforce our Terms or Privacy Policy; respond to claims that an advertisement, posting or other content violates the rights of a third party; or protect the rights, property or personal safety of our users or the general public.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: 14px;&quot;&gt;In all cases, you must give users an opportunity to remove themselves from your database and a chance to review what information you have collected about them. In addition, under no circumstances, except as defined in this Section, can you disclose personally identifiable information about another user to any third party without our consent and the consent of such other user after adequate disclosure.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;KasturiCollection.com and our users do not tolerate spam. Therefore, without limiting the foregoing, you are not licensed to add a KasturiCollection.com user-even a user who has purchased an item from you-to your mail list (email or physical mail) without their express consent after adequate disclosure.&lt;/span&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;What about children\'s privacy?&lt;/span&gt;&lt;/b&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Use of KasturiCollection.com is available only to persons who can form a legally binding contract under the Indian Contract Act, 1872. If you are under the age of 18, you cannot buy or sell any items on the Site. If you wish to purchase or sell an item on the Site such purchase or sale may be made by your legal guardian or parents who have registered as users of the Site.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Access or change your personally identifiable information&lt;/span&gt;&lt;/b&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;To protect your privacy and security, we will verify your identity before granting access or making changes to your personally identifying information. If you have registered your profile on KasturiCollection.com, your registered user ID and Password are required in order to access your profile information.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Security&lt;/span&gt;&lt;/b&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;When you place orders or access your account information, we offer the use of a secure server. The secure server software (SSL) encrypts all information you put in before it is sent to us. Once your information is in our possession we adhere to strict security guidelines in compliance with the (Indian) Information Technology Act, 2000, protecting it against unauthorized access.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Your Consent&lt;/span&gt;&lt;/b&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;By using the Site and/ or by providing your information, you acknowledge our use of your personal information in the manner as set out in this Privacy Policy. Any changes to our privacy policy will be communicated through our Web site at least 10 days in advance of implementation. Name and address of the entity collecting and retaining your information shall be the contracting entity stated in the KasturiCollection.com User Agreement.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Grievance Officer:&lt;/span&gt;&lt;/b&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;In accordance with Information Technology Act 2000 and rules made there under, the name and contact details of the Grievance Officer are published on the Site in User Agreement.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;INSERT INTO oc_information_description VALUES("6","1","Delivery Information","&lt;p align=&quot;justify&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;span style=&quot;color: rgb(102, 102, 102);&quot;&gt;The shipping charges are not fixed and depend on various factors like nature / category of your product, which location despatched from, gross weight of the product.T&lt;/span&gt;&lt;span style=&quot;color: rgb(102, 102, 102);&quot;&gt;he shipping charge would reflect on the shopping cart / payment page.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p align=&quot;justify&quot;&gt;&lt;span style=&quot;color: rgb(102, 102, 102);&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;The average delivery time will be 5-7 working days.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p align=&quot;justify&quot; style=&quot;margin-bottom: 20px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 20px; border: 0px; vertical-align: baseline; padding: 0px; color: rgb(102, 102, 102); text-align: justify;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;We are committed to delivering your order accurately, in good condition, and always on time promised by our customer care executive or on website or mobile. Below are some more shipping related points:&lt;/font&gt;&lt;/p&gt;&lt;table class=&quot;text-section shipping-policy-table&quot; width=&quot;98%&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot; border=&quot;0&quot; align=&quot;justify&quot; style=&quot;background-color: rgb(255, 255, 255); font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 20px; border: 0px; vertical-align: baseline; margin: 0px; padding: 0px; color: rgb(102, 102, 102); text-align: justify;&quot;&gt;&lt;tbody&gt;&lt;tr style=&quot;border: 0px; vertical-align: baseline; margin: 0px; padding: 0px;&quot;&gt;&lt;td width=&quot;4%&quot; valign=&quot;top&quot; height=&quot;37&quot; align=&quot;right&quot; style=&quot;padding-bottom: 12px; border: 0px; vertical-align: top; margin: 0px;&quot;&gt;&lt;span class=&quot;style5&quot; style=&quot;border: 0px; vertical-align: baseline; margin: 0px; padding: 0px;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&amp;nbsp;&amp;nbsp;*&lt;/font&gt;&lt;/span&gt;&lt;/td&gt;&lt;td valign=&quot;top&quot; style=&quot;padding-bottom: 12px; border: 0px; vertical-align: top; margin: 0px;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&amp;nbsp;&lt;/font&gt;&lt;/td&gt;&lt;td valign=&quot;top&quot; style=&quot;padding-bottom: 12px; border: 0px; vertical-align: top; margin: 0px;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;Each order would be shipped only to a single destination address specified at the time of payment for that order. If you wish to ship products to different addresses, you shall need to place multiple orders.&lt;/font&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr style=&quot;border: 0px; vertical-align: baseline; margin: 0px; padding: 0px;&quot;&gt;&lt;td width=&quot;4%&quot; valign=&quot;top&quot; height=&quot;50&quot; align=&quot;right&quot; style=&quot;padding-bottom: 12px; border: 0px; vertical-align: top; margin: 0px;&quot;&gt;&lt;span class=&quot;style5&quot; style=&quot;border: 0px; vertical-align: baseline; margin: 0px; padding: 0px;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&amp;nbsp;&amp;nbsp;*&lt;/font&gt;&lt;/span&gt;&lt;/td&gt;&lt;td valign=&quot;top&quot; style=&quot;padding-bottom: 12px; border: 0px; vertical-align: top; margin: 0px;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&amp;nbsp;&lt;/font&gt;&lt;/td&gt;&lt;td valign=&quot;top&quot; style=&quot;padding-bottom: 12px; border: 0px; vertical-align: top; margin: 0px;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;We make our best efforts to ensure that each item in your order is shipped out within 4-5 working days of the order date. However in some cases, it may take longer, upto 6 or more working days.&lt;/font&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr style=&quot;border: 0px; vertical-align: baseline; margin: 0px; padding: 0px;&quot;&gt;&lt;td width=&quot;4%&quot; valign=&quot;top&quot; height=&quot;25&quot; align=&quot;right&quot; style=&quot;padding-bottom: 12px; border: 0px; vertical-align: top; margin: 0px;&quot;&gt;&lt;span class=&quot;style5&quot; style=&quot;border: 0px; vertical-align: baseline; margin: 0px; padding: 0px;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&amp;nbsp;&amp;nbsp;*&lt;/font&gt;&lt;/span&gt;&lt;/td&gt;&lt;td valign=&quot;top&quot; style=&quot;padding-bottom: 12px; border: 0px; vertical-align: top; margin: 0px;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&amp;nbsp;&lt;/font&gt;&lt;/td&gt;&lt;td valign=&quot;top&quot; style=&quot;padding-bottom: 12px; border: 0px; vertical-align: top; margin: 0px;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;Orders will be shipped out orders on all week days (Monday to Saturday), excluding public holidays.&lt;/font&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr style=&quot;border: 0px; vertical-align: baseline; margin: 0px; padding: 0px;&quot;&gt;&lt;td width=&quot;4%&quot; valign=&quot;top&quot; height=&quot;37&quot; align=&quot;right&quot; style=&quot;padding-bottom: 12px; border: 0px; vertical-align: top; margin: 0px;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;br&gt;&lt;/font&gt;&lt;/td&gt;&lt;td valign=&quot;top&quot; style=&quot;padding-bottom: 12px; border: 0px; vertical-align: top; margin: 0px;&quot;&gt;&lt;font face=&quot;Verdana&quot;&gt;&lt;br&gt;&lt;/font&gt;&lt;/td&gt;&lt;td valign=&quot;top&quot; style=&quot;padding-bottom: 12px; border: 0px; vertical-align: top; margin: 0px;&quot;&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;INSERT INTO oc_information_description VALUES("7","1","Cancellation Policy","&lt;p&gt;&lt;span style=&quot;font-size: 14px; line-height: 16.1px; color: rgb(107, 105, 105);&quot;&gt;&lt;font face=&quot;Tahoma&quot;&gt;Kasturi Collection ensures that your order is safely delivered to you within the promised delivery timeline. However, if you have ordered a wrong you may cancel the order by calling us on 7058756668.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Your order will not be cancelled if the product is already dispatched from our end.&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;If the product is not dispatched then we will process your cancellation request.&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;You will receive the refund within 7 working days.&amp;nbsp;&lt;/span&gt;&lt;/li&gt;&lt;/ul&gt;","Cancellation Policy","","");
INSERT INTO oc_information_description VALUES("8","1","Order Tracking","&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;&lt;a href=&quot;https://shipway.in/the_professional_couriers&quot; style=&quot;background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;P&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;lease follow below steps to track your order...&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;&lt;a href=&quot;https://shipway.in/the_professional_couriers&quot; style=&quot;background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;1&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;) Login to your account&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;2) Go to Order History&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;3) View the Order&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;4) Go to Order History and Check the Tracking Number in front of status :&lt;/span&gt;&lt;span style=&quot;color: rgb(102, 102, 102); font-size: 12px;&quot;&gt;Shipped&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(102, 102, 102); font-size: 12px;&quot;&gt;5) Click on below link and enter the Tracking Number.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://shipway.in/the_professional_couriers&quot; style=&quot;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Track Your Order&lt;/span&gt;&lt;/b&gt;&lt;/a&gt;&lt;/p&gt;","Order Tracking","","");
INSERT INTO oc_information_description VALUES("9","1","Payment Options","&lt;p&gt;&lt;img src=&quot;http://kasturicollection.com/multivendor/image/catalog/Net-Banking-CCAvenue.jpg&quot; style=&quot;width: 841px;&quot;&gt;&lt;br&gt;&lt;/p&gt;","Payment Options","","");
INSERT INTO oc_information_description VALUES("10","1","Returns Policy","&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;?&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;white-space: pre; font-size: 14px;&quot;&gt;	&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;You can place a Return request within 10 days of order delivery. However, in case of Damaged/Missing Product, the Return request should be filed within 2 days of delivery.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;white-space: pre; font-size: 14px;&quot;&gt;	&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Return request will be reviewed by Kasturi Collection.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;white-space: pre; font-size: 14px;&quot;&gt;	&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;If required, request will be shared with the merchant for his/her approval.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;white-space: pre; font-size: 14px;&quot;&gt;	&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;After approval, pickup of the product will be arranged through our courier partners.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;white-space: pre; font-size: 14px;&quot;&gt;	&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;If our reverse pickup service is not available on your address, we will ask you to dispatch the product.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;white-space: pre; font-size: 14px;&quot;&gt;	&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;After the product is received, it is verified against your claim and accordingly, Replacement or Refund is initiated. Please note that Replacement would depend upon the stock availability.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;b&gt;Process to Return the Product is as follows...&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1) Login to Kasturi Collection&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;img src=&quot;http://kasturicollection.com/image/catalog/loginpage.jpg&quot; style=&quot;width: 441px;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2) Navigate to My Account &amp;gt; Order History&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;3) Click on the Returns button in front of the Product which you wish to return.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;img src=&quot;http://kasturicollection.com/image/catalog/returns.jpg&quot; style=&quot;width: 841px;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px; line-height: 16.1px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;4) Fill up all the details and submit the form.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px; line-height: 16.1px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 14px; line-height: 16.1px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Under what conditions can I return/ replace my product&lt;/font&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;white-space: pre;&quot;&gt;	&lt;/span&gt;Wrong Product  Wrong color/ size/ style&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;white-space: pre;&quot;&gt;	&lt;/span&gt;Wrong item ordered/ delivered&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;white-space: pre;&quot;&gt;	&lt;/span&gt;Unsatisfactory Product  Inauthentic/ Low Quality/ Expired&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;white-space: pre;&quot;&gt;	&lt;/span&gt;Defective Product - Manufacturing defect/ Non-functioning (Not applicable, if the product is under Manufacturers Warranty)&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;white-space: pre;&quot;&gt;	&lt;/span&gt;Damaged Product  Physical damage/ Tampered product or packaging&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;white-space: pre;&quot;&gt;	&lt;/span&gt;Wrong Quantity  Missing Products/ Parts&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;white-space: pre;&quot;&gt;	&lt;/span&gt;No Invoice/Warranty Received  Available on Electronics only&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;b&gt;&lt;span style=&quot;line-height: 16.1px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Under what conditions returns/ replacement request will not be accepted?&lt;/font&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;&lt;div style=&quot;text-align: justify;&quot;&gt;&lt;div&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;white-space: pre; font-size: 14px;&quot;&gt;	&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;If Products are Altered/ Used&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;white-space: pre; font-size: 14px;&quot;&gt;	&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;For Damaged/Missing product that is reported after 2 days of the delivery&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;b style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/b&gt;&lt;/div&gt;&lt;div&gt;&lt;b style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&amp;nbsp;What do I do if my area does not have a reverse pick up service?&lt;/font&gt;&lt;/b&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;If our reverse pickup service is not available at your address, we will ask you to dispatch the product. Return address will be notified to you in a separate email, along with the packaging instructions and required documents.&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;Please take care of the following-&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;white-space: pre;&quot;&gt;	&lt;/span&gt;Mention the Order number/Delivery Address on the package, before handing it over to the Courier Representative&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;white-space: pre;&quot;&gt;	&lt;/span&gt;Attach courier receipt to email and send it to order@kasturicollection.com&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;white-space: pre;&quot;&gt;	&lt;/span&gt;Track your Return Shipment on the Courier Company\'s Website.&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;div&gt;&lt;b&gt;How do I track the status of my Return request?&lt;/b&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;white-space: pre;&quot;&gt;	&lt;/span&gt;Check the status of your Return at My Accounts -&amp;gt; Returns Section and click on particular Return ID to view return details.&amp;nbsp;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;white-space: pre;&quot;&gt;	&lt;/span&gt;After receiving your Return Request, we will update you on the status i.e. Acceptance/Rejection of Reverse Pickup, Reshipment &amp;amp; Refund.&lt;br&gt;&lt;/div&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;","Returns Policy","","");
