INSERT INTO oc_modification VALUES("1","1","Whatsapp order","whatapp order","Waqar Ansari","1.0","http://localhost/opencart/upload","<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n	<name>Whatsapp order</name>\n	<code>whatapp order</code>\n	<version>1.0</version>\n	<author>Waqar Ansari</author>\n	<link>http://localhost/opencart/upload</link>\n	\n	<file path=\"admin/language/en-gb/setting/setting.php\">\n		<operation>\n			<search><![CDATA[$_[\'heading_title\']                  = \'Settings\';]]></search>\n			<add position=\"after\"><![CDATA[\n				//Fields \n				$_[\'entry_whatsappno\'] = \'Your/Store Whatsapp Number:*\';\n				$_[\'entry_whatsappno_buttontext\'] = \'Button Text\';\n				$_[\'entry_whatsapp_message\'] = \'Message\';\n				$_[\'entry_whatsapp_showonheader\'] = \'Show on top\';\n				$_[\'entry_whatsapp_showonfooter\'] = \'Show on bottom\';\n			]]></add>\n		</operation>\n	</file>\n	<file path=\"admin/controller/setting/setting.php\">\n		<operation>\n			<search><![CDATA[$data[\'breadcrumbs\'] = array();]]></search>\n			<add position=\"after\"><![CDATA[\n				//Fields \n				$data[\'entry_whatsappno\'] = $this->language->get(\'entry_whatsappno\');\n				$data[\'entry_whatsappno_buttontext\'] = $this->language->get(\'entry_whatsappno_buttontext\');\n				$data[\'entry_whatsapp_message\'] = $this->language->get(\'entry_whatsapp_message\');\n				$data[\'entry_whatsapp_showonheader\'] = $this->language->get(\'entry_whatsapp_showonheader\');\n				$data[\'entry_whatsapp_showonfooter\'] = $this->language->get(\'entry_whatsapp_showonfooter\');\n				\n			]]></add>\n		</operation>\n		<operation>\n			<search><![CDATA[$data[\'user_token\'] = $this->session->data[\'user_token\'];]]></search>\n			<add position=\"after\"><![CDATA[\n					if (isset($this->request->post[\'config_whatsapp_no\'])) {\n						$data[\'config_whatsapp_no\'] = $this->request->post[\'config_whatsapp_no\'];\n					} else {\n						$data[\'config_whatsapp_no\'] = ($this->config->get(\'config_whatsapp_no\') == \"\")? \"+44123xxxxxx\" : $this->config->get(\'config_whatsapp_no\');\n					}\n					if (isset($this->request->post[\'config_whatsapp_btntext\'])) {\n						$data[\'config_whatsapp_btntext\'] = $this->request->post[\'config_whatsapp_btntext\'];\n					} else {\n						$data[\'config_whatsapp_btntext\'] = ($this->config->get(\'config_whatsapp_btntext\') == \"\")? \"Order On Whatsapp\": $this->config->get(\'config_whatsapp_btntext\');\n					}\n					if (isset($this->request->post[\'config_whatsapp_msg\'])) {\n						$data[\'config_whatsapp_msg\'] = $this->request->post[\'config_whatsapp_msg\'];\n					} else {\n						$data[\'config_whatsapp_msg\'] = ($this->config->get(\'config_whatsapp_msg\') == \"\")? \"Hi, I would like to buy\" : $this->config->get(\'config_whatsapp_msg\');\n					}\n					if (isset($this->request->post[\'config_whatsapp_ontop\'])) {\n						$data[\'config_whatsapp_ontop\'] = $this->request->post[\'config_whatsapp_ontop\'];\n					} else {\n						$data[\'config_whatsapp_ontop\'] = $this->config->get(\'config_whatsapp_ontop\');\n					}\n					if (isset($this->request->post[\'config_whatsapp_onbottom\'])) {\n						$data[\'config_whatsapp_onbottom\'] = $this->request->post[\'config_whatsapp_onbottom\'];\n					} else {\n						$data[\'config_whatsapp_onbottom\'] = $this->config->get(\'config_whatsapp_onbottom\');\n					}\n				]]></add>\n		</operation>\n	</file>\n	<file path=\"admin/view/template/setting/setting.twig\">\n		<operation>\n			<search><![CDATA[<li><a href=\"#tab-server\" data-toggle=\"tab\">{{ tab_server }}</a></li>]]></search>\n			<add position=\"after\"><![CDATA[\n			<li><a href=\"#tab-whatsapp\" data-toggle=\"tab\">Whatsapp Order</a></li>\n			]]></add>\n		</operation>\n		<operation>\n			<search><![CDATA[<div class=\"tab-content\">]]></search>\n			<add position=\"after\"><![CDATA[\n				<div class=\"tab-pane\" id=\"tab-whatsapp\">\n				 <div class=\"form-group\">\n	                <label class=\"col-sm-2 control-label\" for=\"input-meta-title\">{{ entry_whatsappno }}</label>\n	                <div class=\"col-sm-10\">\n	                  <input type=\"text\" name=\"config_whatsapp_no\" value=\"{{ config_whatsapp_no }}\" placeholder=\"{{ config_whatsapp_no }}\" id=\"input-meta-title\" class=\"form-control\" />\n	                </div>\n	              </div>\n	              <div class=\"form-group\">\n	                <label class=\"col-sm-2 control-label\" for=\"input-meta-title\">{{ entry_whatsappno_buttontext }}</label>\n	                <div class=\"col-sm-10\">\n	                  <input type=\"text\" name=\"config_whatsapp_btntext\" value=\"{{ config_whatsapp_btntext }}\" placeholder=\"{{ config_whatsapp_btntext }}\" id=\"input-meta-title\" class=\"form-control\" />\n	                </div>\n	              </div>\n	              <div class=\"form-group\">\n	                <label class=\"col-sm-2 control-label\" for=\"input-meta-title\">{{ entry_whatsapp_message }}</label>\n	                <div class=\"col-sm-10\">\n	                 <textarea name=\"config_whatsapp_msg\" id=\"input-whatsapp-msg\" class=\"form-control\">{{ config_whatsapp_msg}}</textarea>	\n	                </div>\n	              </div>\n	              <div class=\"form-group\">\n	                <label class=\"col-sm-2 control-label\" for=\"input-meta-title\">{{ entry_whatsapp_showonheader }}</label>\n	                <div class=\"col-sm-10\">\n	                	<select name=\"config_whatsapp_ontop\" class=\"form-control\">\n	                		<option>-- Select --</option>\n	                		<option value=\"1\" {{ (config_whatsapp_ontop == 1) ? \'selected\' : \'\' }}>Yes</option>\n	                		<option value=\"0\" {{ (config_whatsapp_ontop == 0) ? \'selected\' : \'\' }}>No</option>\n	                	</select>\n	                </div>\n	              </div>\n	              <div class=\"form-group\">\n	                <label class=\"col-sm-2 control-label\" for=\"input-meta-title\">{{ entry_whatsapp_showonfooter }} </label>\n	                <div class=\"col-sm-10\">\n	                	<select name=\"config_whatsapp_onbottom\" class=\"form-control\">\n	                		<option>-- Select --</option>\n	                		<option value=\"1\" {{ (config_whatsapp_onbottom == 1) ? \'selected\' : \'\' }}>Yes</option>\n	                		<option value=\"0\" {{ (config_whatsapp_onbottom == 0) ? \'selected\' : \'\' }}>No</option>\n	                	</select>\n	                </div>\n	              </div>\n				</div>\n			]]></add>\n		</operation>\n	</file>	\n	<file path=\"catalog/controller/product/product.php\">\n		<operation>\n			<search><![CDATA[$data[\'products\'] = array();]]></search>\n			<add position=\"before\"><![CDATA[\n				$data[\"wa_whatsapp_no\"] = preg_replace(\'/[^A-Za-z0-9\\-]/\', \'\', $this->config->get(\'config_whatsapp_no\'));\n				$data[\"wa_whatsapp_btntext\"] = $this->config->get(\'config_whatsapp_btntext\');\n				$data[\"wa_whatsapp_msg\"] = ($this->config->get(\'config_whatsapp_msg\') == \"\")?\"Hi, I would like to buy\":$this->config->get(\'config_whatsapp_msg\');\n				$data[\"wa_share\"] = urlencode($data[\'share\']);\n				$iphone = strpos($this->request->server[\'HTTP_USER_AGENT\'],\"iPhone\");\n				$android = strpos($this->request->server[\'HTTP_USER_AGENT\'],\"Android\");\n				$palmpre = strpos($this->request->server[\'HTTP_USER_AGENT\'],\"webOS\");\n				$berry =strpos($this->request->server[\'HTTP_USER_AGENT\'],\"BlackBerry\");\n				$ipod =strpos($this->request->server[\'HTTP_USER_AGENT\'],\"iPod\");\n				if ($iphone || $android || $palmpre || $ipod || $berry == true){\n				$data[\"wa_link\"] = \"https://api.whatsapp.com/send?phone\";\n				}else{\n				$data[\"wa_link\"] = \"https://web.whatsapp.com/send?phone\";\n				}\n			]]></add>\n		</operation>\n	</file>\n	<file path=\"catalog/view/theme/*/template/product/product.twig\">\n		<operation>\n			<search><![CDATA[{{ button_cart }}]]></search>\n			<add position=\"before\"><![CDATA[\n				<a style=\"width:100%;font-size:16px;text-transform:none;background-color:#25d366;border-radius: 400px;margin-top:10px;color:#fff\" class=\"btn  btn-lg btn-block\" id=\"wa_whatsappbtn\" href=\"{{wa_link}}={{wa_whatsapp_no}}&text={{wa_whatsapp_msg}}%20{{heading_title}}%20{{wa_share}}\">  <span class=\"button-cart-text\"> <i class=\"fa fa-whatsapp\"></i> {{wa_whatsapp_btntext}}</span></a>\n			]]></add>\n		</operation>\n	</file>\n	<file path=\"catalog/controller/common/header.php\">\n		<operation>\n			<search><![CDATA[$this->load->language(\'common/header\');]]></search>\n			<add position=\"after\"><![CDATA[\n				$data[\"wa_whatsapp_no\"] = preg_replace(\'/[^A-Za-z0-9\\-]/\', \'\', $this->config->get(\'config_whatsapp_no\'));\n				$data[\"wa_whatsapp_btntext\"] = $this->config->get(\'config_whatsapp_btntext\');\n				$data[\"wa_whatsapp_msg\"] = $this->config->get(\'config_whatsapp_msg\');\n				$data[\"wa_whatsapp_ontop\"] = $this->config->get(\'config_whatsapp_ontop\');\n				$iphone = strpos($this->request->server[\'HTTP_USER_AGENT\'],\"iPhone\");\n				$android = strpos($this->request->server[\'HTTP_USER_AGENT\'],\"Android\");\n				$palmpre = strpos($this->request->server[\'HTTP_USER_AGENT\'],\"webOS\");\n				$berry =strpos($this->request->server[\'HTTP_USER_AGENT\'],\"BlackBerry\");\n				$ipod =strpos($this->request->server[\'HTTP_USER_AGENT\'],\"iPod\");\n				if ($iphone || $android || $palmpre || $ipod || $berry == true){\n				$data[\"wa_link\"] = \"https://api.whatsapp.com/send?phone\";\n				}else{\n				$data[\"wa_link\"] = \"https://web.whatsapp.com/send?phone\";\n				}\n			]]></add>\n		</operation>\n	</file>\n	<file path=\"catalog/view/theme/*/template/common/header.twig\">\n		<operation>\n			<search><![CDATA[{{ telephone }}]]></search>\n			<add position=\"before\"><![CDATA[\n				<li><a href=\"{{wa_link}}={{wa_whatsapp_no}}\" target=\"_blank\"><i class=\"fa fa-whatsapp\"></i> <span class=\"hidden-xs hidden-sm hidden-md\">chat on whatsapp</span></a></li>\n			]]></add>\n		</operation>\n\n	</file>\n	<file path=\"catalog/controller/common/footer.php\">\n		<operation>\n			<search><![CDATA[$this->load->language(\'common/footer\');]]></search>\n			<add position=\"after\"><![CDATA[\n				$data[\"wa_whatsapp_no\"] = preg_replace(\'/[^A-Za-z0-9\\-]/\', \'\', $this->config->get(\'config_whatsapp_no\'));\n				$data[\"wa_whatsapp_btntext\"] = $this->config->get(\'config_whatsapp_btntext\');\n				$data[\"wa_whatsapp_msg\"] = $this->config->get(\'config_whatsapp_msg\');\n				$data[\"wa_whatsapp_onbottom\"] = $this->config->get(\'config_whatsapp_onbottom\');\n				$iphone = strpos($this->request->server[\'HTTP_USER_AGENT\'],\"iPhone\");\n				$android = strpos($this->request->server[\'HTTP_USER_AGENT\'],\"Android\");\n				$palmpre = strpos($this->request->server[\'HTTP_USER_AGENT\'],\"webOS\");\n				$berry =strpos($this->request->server[\'HTTP_USER_AGENT\'],\"BlackBerry\");\n				$ipod =strpos($this->request->server[\'HTTP_USER_AGENT\'],\"iPod\");\n				if ($iphone || $android || $palmpre || $ipod || $berry == true){\n				$data[\"wa_link\"] = \"https://api.whatsapp.com/send?phone\";\n				}else{\n				$data[\"wa_link\"] = \"https://web.whatsapp.com/send?phone\";\n				}\n			]]></add>\n		</operation>\n	</file>\n\n	<file path=\"catalog/view/theme/*/template/common/footer.twig\">\n		<operation>\n			<search><![CDATA[<footer>]]></search>\n			<add position=\"before\"><![CDATA[\n				 \n				 	{% if wa_whatsapp_onbottom == 1 %}\n				 <style>\n				 	.wcf2w_button {\n					    border-radius: 50px!important;\n					    text-align: center!important;\n					    padding: 0px!important;\n					    outline: none!important;\n					    text-decoration: none!important;\n					    border: none!important;\n					    box-shadow: none!important;\n					    position: fixed;\n					    width: 60px;\n					    height: 60px;\n					    margin: 0px!important;\n					    line-height: normal!important;\n					    opacity: 0.9;\n					    z-index: 99999999!important;\n					  }\n					.wcf2w_button:link {\n					    text-decoration: none!important;\n					    outline: none!important;\n					    border: none!important;\n					    box-shadow: none!important;\n					   } \n					  .wcf2w_button i {\n					    font-size: 40px!important;\n					    margin-top: 10px;\n					}    \n				 </style>\n				 <a data-title=\"Contact Us\" href=\"{{wa_link}}={{ wa_whatsapp_no }}\" class=\"  wcf2w_button whatsapp_tooltip\" style=\"right: 20px; bottom: 20px; background-color: #2ecc71; color:#ffffff;\" target=\"_blank\">\n		    	<i class=\"fa fa-whatsapp\"></i>\n		    	</a>\n		    	\n				{% endif %}\n			]]></add>\n		</operation>\n	</file>\n	\n</modification>	","1","2019-02-05 15:25:52");
INSERT INTO oc_modification VALUES("2","2","Indian Rupee Symbol ","Indian Rupee Symbol","IRSSOFT","3.0.x.x","http://www.irssoft.com","<modification>INSERT INTO oc_modification VALUES("4","4","Clean Maintenance Mode Page","Clean Maintenance Mode Page","Harnish Design","1.0","http://www.harnishdesign.net","<?xml version=\"1.0\" encoding=\"utf-8\"?>INSERT INTO oc_modification VALUES("5","5","Order ID Checkout Page","order_id_checkout","xxvirusxx","1.0","https://free-time-info.com/","<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n    <name>Order ID Checkout Page</name>\n    <version>1.0</version>\n    <code>order_id_checkout</code>\n    <author>xxvirusxx</author>\n    <link>https://free-time-info.com/</link>\n        <file path=\"catalog/controller/checkout/success.php\"> \n            <operation>\n                <search><![CDATA[if (isset($this->session->data[\'order_id\'])) {]]></search>\n                <add position=\"after\"><![CDATA[\n		$this->session->data[\'last_order_id\'] = $this->session->data[\'order_id\'];\n			]]></add>\n            </operation>\n            <operation>\n                <search><![CDATA[$data[\'continue\'] = $this->url->link(\'common/home\');]]></search>\n                <add position=\"before\"><![CDATA[\n		$data[\'text_message\'] .= sprintf($this->language->get(\'text_order\'),  $this->session->data[\'last_order_id\']);\n			]]></add>\n            </operation>\n        </file>\n        <file path=\"catalog/language/en-gb/checkout/success.php\"> \n            <operation>\n                <search><![CDATA[// Text]]></search>\n                <add position=\"after\"><![CDATA[$_[\'text_order\']   = \'Your order ID is %s.\';]]></add>\n            </operation>\n        </file>\n</modification>","1","2019-03-14 14:05:37");
INSERT INTO oc_modification VALUES("6","6","Order Tracking Extension","order_tracking_module","Shahzeb Sheikh","1.2","","<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n<name>Order Tracking Extension</name>\n<code>order_tracking_module</code>\n<version>1.2</version>\n<author>Shahzeb Sheikh</author>\n\n<file path=\"catalog/controller/common/footer.php\">\n<operation>\n<search>\n<![CDATA[return $this->load->view(\'common/footer\', $data);]]>\n</search>\n<add position=\"before\">\n<![CDATA[   \n$data[\'order_tracking_module\'] = $this->load->controller(\'extension/module/order_tracking\');\n\n]]>\n</add>\n</operation>\n</file> \n<file path=\"catalog/view/theme/*/template/common/footer.twig\">\n<operation>\n<search>\n<![CDATA[</body></html>]]>\n</search>\n<add position=\"before\">\n<![CDATA[   \n{{ order_tracking_module }}\n]]>\n</add>\n</operation>\n</file>\n\n\n\n\n<file path=\"catalog/controller/common/header.php\">\n<operation>\n<search>\n<![CDATA[ return $this->load->view(\'common/header\', $data);]]>\n</search>\n<add position=\"before\">\n<![CDATA[   \n$data[\'order_tracking_module\'] = $this->config->get(\'order_tracking_status\');\n$data[\'order_tracking_custom_html\'] = html_entity_decode($this->config->get(\'order_tracking_custom_html\'));\n$data[\'order_tracking_module\'] = $this->load->controller(\'extension/module/order_tracking\');\n\n]]>\n</add>\n</operation>\n</file> \n<file path=\"catalog/view/theme/*/template/common/header.twig\">\n<operation>\n<search>\n<![CDATA[<body>]]>\n</search>\n<add position=\"after\">\n<![CDATA[   \n{% if  order_tracking_module %}\n{{ order_tracking_custom_html }}\n{% endif %}\n]]>\n</add>\n</operation>\n\n<operation>\n<search>\n<![CDATA[<body class=\"{{cls_body}}\">]]>\n</search>\n<add position=\"after\">\n<![CDATA[   \n{% if  order_tracking_module %}\n{{ order_tracking_module }}\n{% endif %}\n]]>\n</add>\n</operation>\n</file> \n\n\n\n\n</modification>","1","2019-03-14 14:06:17");
INSERT INTO oc_modification VALUES("7","7","Catalog - Menu home button","mmoc-catalog-menu-home-button","Peter Maier","3-1.0","http://mig-media.com","<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n    <name>Catalog - Menu home button</name>\n    <code>mmoc-catalog-menu-home-button</code>\n    <version>3-1.0</version>\n    <author>Peter Maier</author>\n    <link>http://mig-media.com</link>\n	<file path=\"catalog/view/theme/*/template/common/menu.twig\">\n	  <operation error=\"skip\">\n		<search><![CDATA[<ul class=\"nav navbar-nav\">]]></search>\n		<add position=\"after\"><![CDATA[<li><a href=\"{{ home }}\"><i class=\"fa fa-home\"></i></a></li>]]></add>\n	  </operation>\n	</file>\n</modification>\n","1","2019-03-14 14:12:19");
INSERT INTO oc_modification VALUES("8","9","Two Factor Authentication for Open Cart 3 admin panel","gelderblominternet_tfa_ocmod","Gelderblom Internet Solutions","3.0.2.0","https://gelderblominternet.nl","<modification>\n    <name>Two Factor Authentication for Open Cart 3 admin panel</name>\n    <version>3.0.2.0</version>\n    <link>https://gelderblominternet.nl</link>\n    <author><![CDATA[Gelderblom Internet Solutions]]></author>\n    <code>gelderblominternet_tfa_ocmod</code>\n\n    <file path=\"admin/controller/common/login.php\">\n        <operation>\n            <search><![CDATA[$this->session->data[\'user_token\'] = token(32);]]></search>\n            <add position=\"after\"><![CDATA[\n            if (!isset($this->session->data[\'user_id\']) || $this->session->data[\'user_id\'] == 0 && isset($this->session->data[\'tfa_user_id\']) && $this->session->data[\'tfa_user_id\'] > 0) {\n                $this->response->redirect($this->url->link(\'extension/tfaauthenticate\', \'user_token=\' . $this->session->data[\'user_token\'], true));\n            }\n            ]]></add>\n        </operation>\n    </file>\n    <file path=\"admin/model/user/user.php\">\n        <operation>\n            <search><![CDATA[public function editPassword($user_id, $password) {]]></search>\n            <add position=\"before\"><![CDATA[\n            public function editTfa($user_id, $tfa_enable, $shared_secret, $backup_code, $salt) {\n                $this->db->query(\"UPDATE `\" . DB_PREFIX . \"user` SET tfa_enable = \'\" . $this->db->escape($tfa_enable) . \"\', shared_secret = \'\" . $this->db->escape($shared_secret) . \"\', backup_code = \'\" . $this->db->escape(sha1($salt . sha1($salt . sha1($backup_code)))) . \"\' WHERE user_id = \'\" . (int)$user_id . \"\'\");\n            }\n            ]]></add>\n        </operation>\n    </file>\n    <file path=\"admin/controller/startup/permission.php\">\n        <operation>\n            <search><![CDATA[\'common/dashboard\',]]></search>\n            <add position=\"before\"><![CDATA[\n            \'extension/tfaauthenticate\',\n            ]]></add>\n        </operation>\n    </file>\n    <file path=\"admin/controller/startup/login.php\">\n        <operation>\n            <search><![CDATA[\'common/login\',]]></search>\n            <add position=\"before\"><![CDATA[\n            \'extension/tfaauthenticate\',\n            ]]></add>\n        </operation>\n    </file>\n    <file path=\"system/library/cart/user.php\">\n        <operation>\n            <search><![CDATA[public function login($username, $password) {]]></search>\n            <add position=\"before\"><![CDATA[\n            public function backupcode($user_id, $backup_code) {\n                $user_query = $this->db->query(\"SELECT * FROM \" . DB_PREFIX . \"user WHERE user_id = \'\" . $this->db->escape($user_id) . \"\' AND backup_code = SHA1(CONCAT(salt, SHA1(CONCAT(salt, SHA1(\'\" . $this->db->escape($backup_code) . \"\'))))) AND status = \'1\'\");\n                if ($user_query->num_rows) {\n                    return true;\n                }\n                return false;\n            }\n            ]]></add>\n        </operation>\n        <operation>\n            <search><![CDATA[$this->session->data[\'user_id\'] = $user_query->row[\'user_id\'];]]></search>\n            <add position=\"replace\"><![CDATA[\n            if (isset($user_query->row[\'tfa_enable\']) && $user_query->row[\'tfa_enable\'] == 1) {\n                $this->session->data[\'tfa_user_id\'] = $user_query->row[\'user_id\'];\n            } else {\n                $this->session->data[\'user_id\'] = $user_query->row[\'user_id\'];\n            }\n            ]]></add>\n        </operation>\n    </file>\n    <file path=\"admin/controller/common/header.php\">\n        <operation>\n            <search><![CDATA[$data[\'profile\'] = $this->url->link(\'common/profile\', \'user_token=\' . $this->session->data[\'user_token\'], true);]]></search>\n            <add position=\"after\"><![CDATA[\n            $data[\'tfa\'] = $this->url->link(\'extension/tfa/setup\', \'user_token=\' . $this->session->data[\'user_token\'], true);\n            ]]></add>\n        </operation>\n    </file>\n    <file path=\"admin/language/en-gb/common/header.php\">\n        <operation>\n            <search><![CDATA[$_[\'text_profile\']]]></search>\n            <add position=\"before\"><![CDATA[\n            $_[\'text_tfa\']       = \'Two Factor Authentication\';\n            ]]></add>\n        </operation>\n    </file>\n    <file path=\"admin/language/nl-nl/common/header.php\">\n        <operation>\n            <search><![CDATA[$_[\'text_profile\']]]></search>\n            <add position=\"before\"><![CDATA[\n            $_[\'text_tfa\']       = \'Twee Factor Authenticatie\';\n            ]]></add>\n        </operation>\n    </file>\n    <file path=\"admin/view/template/common/header.twig\">\n        <operation>\n            <search><![CDATA[<li><a href=\"{{ profile }}\"><i class=\"fa fa-user-circle-o fa-fw\"></i> {{ text_profile }}</a></li>]]></search>\n            <add position=\"after\"><![CDATA[\n            <li><a href=\"{{ tfa }}\"><i class=\"fa fa-shield fa-fw\"></i> {{ text_tfa }}</a></li>\n            ]]></add>\n        </operation>\n    </file>\n</modification>\n","1","2019-03-14 14:18:08");
INSERT INTO oc_modification VALUES("9","13","Adding support for install.php, install.sql when installing exte","EIE001","Nik Chankov","1.0","http://nik.chankov.net/opencart","<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n    <code>EIE001</code>\n    <name>Adding support for install.php, install.sql when installing extensions</name>\n    <version>1.0</version>\n    <email>opencart@chankov.net</email>\n	<link>http://nik.chankov.net/opencart</link>\n    <author>Nik Chankov</author>\n	\n	<file path=\"admin/controller/marketplace/install.php\">\n        <operation>\n            <search trim=\"true\" index=\"0\"><![CDATA[\n        		$json[\'next\'] = str_replace(\'&amp;\', \'&\', $this->url->link(\'marketplace/install/remove\', \'user_token=\' . $this->session->data[\'user_token\'], true));\n            ]]></search>\n            <add position=\"after\" trim=\"false\" offset=\"0\"><![CDATA[\n		  		$json[\'text\'] = $this->language->get(\'text_sql\');\n		  		$json[\'next\'] = str_replace(\'&amp;\', \'&\', $this->url->link(\'marketplace/install/sql\', \'user_token=\' . $this->session->data[\'user_token\'] . \'&extension_install_id=\' . $extension_install_id, true));\n            ]]></add>\n        </operation>\n		<operation>\n            <search trim=\"true\" index=\"0\"><![CDATA[\n          		public function remove() {\n            ]]></search>\n            <add position=\"before\" trim=\"false\" offset=\"0\"><![CDATA[\n				public function php() {\n					$this->load->language(\'marketplace/install\');\n					$json = array();\n					if (isset($this->request->get[\'extension_install_id\'])) {\n						$extension_install_id = $this->request->get[\'extension_install_id\'];\n					} else {\n						$extension_install_id = 0;\n					}\n					if (!$this->user->hasPermission(\'modify\', \'marketplace/install\')) {\n						$json[\'error\'] = $this->language->get(\'error_permission\');\n					}\n					if (!isset($this->session->data[\'install\'])) {\n						$json[\'error\'] = $this->language->get(\'error_directory\');\n					} elseif (!is_dir(DIR_UPLOAD . \'tmp-\' . $this->session->data[\'install\'] . \'/\')) {\n						$json[\'error\'] = $this->language->get(\'error_directory\');\n					}\n					if (!$json) {\n						$file = DIR_UPLOAD . \'tmp-\' . $this->session->data[\'install\'] . \'/install.php\';\n						if (is_file($file)) {\n							try {\n								include($file);\n							} catch(Exception $exception) {\n								$json[\'error\'] = sprintf($this->language->get(\'error_exception\'), $exception->getCode(), $exception->getMessage(), $exception->getFile(), $exception->getLine());\n							}\n						}\n					}\n					if (!$json) {\n						$json[\'text\'] = $this->language->get(\'text_remove\');\n						$json[\'next\'] = str_replace(\'&amp;\', \'&\', $this->url->link(\'marketplace/install/remove\', \'user_token=\' . $this->session->data[\'user_token\'], true));\n					}\n					$this->response->addHeader(\'Content-Type: application/json\');\n					$this->response->setOutput(json_encode($json));\n				}\n\n				public function sql() {\n					$this->load->language(\'marketplace/install\');\n					$json = array();\n					if (isset($this->request->get[\'extension_install_id\'])) {\n						$extension_install_id = $this->request->get[\'extension_install_id\'];\n					} else {\n						$extension_install_id = 0;\n					}\n					if (!$this->user->hasPermission(\'modify\', \'marketplace/install\')) {\n						$json[\'error\'] = $this->language->get(\'error_permission\');\n					}\n					if (!isset($this->session->data[\'install\'])) {\n						$json[\'error\'] = $this->language->get(\'error_directory\');\n					} elseif (!is_dir(DIR_UPLOAD . \'tmp-\' . $this->session->data[\'install\'] . \'/\')) {\n						$json[\'error\'] = $this->language->get(\'error_directory\');\n					}\n\n					if (!$json) {\n						$file = DIR_UPLOAD . \'tmp-\' . $this->session->data[\'install\'] . \'/install.sql\';\n						if (is_file($file)) {\n							$lines = file($file);\n							if ($lines) {\n								try {\n									$sql = \'\';\n									foreach ($lines as $line) {\n										if ($line && (substr($line, 0, 2) != \'--\') && (substr($line, 0, 1) != \'#\')) {\n											$sql .= $line;\n											if (preg_match(\'/;\\s*$/\', $line)) {\n												$sql = str_replace(\" `oc_\", \" `\" . DB_PREFIX, $sql);\n												$this->db->query($sql);\n												$sql = \'\';\n											}\n										}\n									}\n								} catch(Exception $exception) {\n									$json[\'error\'] = sprintf($this->language->get(\'error_exception\'), $exception->getCode(), $exception->getMessage(), $exception->getFile(), $exception->getLine());\n								}\n							}					\n						}\n					}\n\n					if (!$json) {\n						$json[\'text\'] = $this->language->get(\'text_php\');\n						$json[\'next\'] = str_replace(\'&amp;\', \'&\', $this->url->link(\'marketplace/install/php\', \'user_token=\' . $this->session->data[\'user_token\'] . \'&extension_install_id=\' . $extension_install_id, true));\n					}\n\n					$this->response->addHeader(\'Content-Type: application/json\');\n					$this->response->setOutput(json_encode($json));\n				}\n            ]]></add>\n        </operation>\n    </file>\n	\n	<file path=\"admin/language/en-gb/marketplace/install.php\">\n        <operation>\n            <search trim=\"true\" index=\"0\"><![CDATA[\n          		$_[\'text_remove\']      = \'Removing temporary files!\';\n            ]]></search>\n            <add position=\"after\" trim=\"false\" offset=\"0\"><![CDATA[\n		  		$_[\'text_sql\']             = \'Running SQL!\';\n		  		$_[\'text_php\']             = \'Running PHP!\';\n            ]]></add>\n        </operation>\n	</file>\n</modification>","1","2019-03-14 14:26:12");
INSERT INTO oc_modification VALUES("10","14","Installer Fix Allow All directories","installerfixallowalldirectories","GGW support@ggwshop.com","1.0","https://www.opencart.com/index.php?route=marketplace/extension&filter_member=gogoweb","<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n  <name>Installer Fix Allow All directories</name>\n  <code>installerfixallowalldirectories</code>\n  <version>1.0</version>\n  <author>GGW support@ggwshop.com</author>\n  <link><![CDATA[https://www.opencart.com/index.php?route=marketplace/extension&filter_member=gogoweb]]></link>\n\n  <file path=\"admin/controller/marketplace/install.php\">\n	<operation>\n      <search>\n        <![CDATA[if ($safe) {]]>\n      </search>\n      <add position=\"before\">\n        <![CDATA[		\n		$safe = true;\n		]]>\n      </add>\n    </operation>\n    \n    \n    	<operation>\n      <search>\n        <![CDATA[if (is_dir($file) && !is_dir($path)) {]]>\n      </search>\n      <add position=\"before\">\n        <![CDATA[		\n						if ($path == \'\') {\n							// Get the ROOT\n							$app_root = explode(\'/\',DIR_APPLICATION);\n							unset($app_root[count($app_root)-2]);\n							$app_root = implode(\'/\',$app_root);\n							\n							//FIX this shit!\n							$path = $app_root . $destination;\n\n						}\n\n		]]>\n      </add>\n    </operation>\n  </file> \n</modification>\n","1","2019-03-14 14:26:21");
INSERT INTO oc_modification VALUES("11","15","Menu Payment Confirmation","menu_payment_confirmation","aauwwo","1.3.3.0","http://www.opencart.com/index.php?route=marketplace/extension&filter_member=aauwwo","<?xml version=\"1.0\" encoding=\"UTF-8\"?>INSERT INTO oc_modification VALUES("12","16","Toggle Admin Menu Left","Toggle Admin Menu Left","Lab129.com","1.0","http://lab129.com/","<?xml version=\"1.0\" encoding=\"utf-8\"?>INSERT INTO oc_modification VALUES("13","17","Clearcart V3","Clearcart V3","Chris Spence","3.0"," ","<modification>\n	<name>Clearcart V3</name>\n	<code>Clearcart V3</code>\n	<version>3.0</version>\n	<author>Chris Spence</author>\n	<link> </link>\n <file path=\"catalog/view/theme/*/template/common/cart.twig\">\n\n	        <operation>\n\n	            <search><![CDATA[<a href=\"{{ cart }}\"><strong><i class=\"fa fa-shopping-cart\"></i> {{ text_cart }}</strong></a>&nbsp;&nbsp;&nbsp;<a href=\"{{ checkout }}\"><strong><i class=\"fa fa-share\"></i> {{ text_checkout }}</strong></a></p>]]></search>\n\n	            <add position=\"replace\"><![CDATA[\n\n	            <a href=\"{{ link_clearcart }}\"  ><strong><i class=\"glyphicon glyphicon-trash\"></i> {{button_clearcart }}</strong></a>&nbsp;&nbsp;&nbsp;<a href=\"{{ cart }}\"><strong><i class=\"fa fa-shopping-cart\"></i> {{ text_cart }}</strong></a>&nbsp;&nbsp;&nbsp;<a href=\"{{ checkout }}\"><strong><i class=\"fa fa-share\"></i> {{ text_checkout }}</strong></a></p>\n\n	            ]]></add>\n\n	        </operation>\n\n	    </file>\n\n	  <file path=\"catalog/controller/common/cart.php\">\n\n	        <operation>\n\n	            <search><![CDATA[public function info() {]]></search>\n\n	            <add position=\"before\"><![CDATA[\n\n	            public function clearcart() {\n\n	                $this->load->language(\'checkout/cart\');\n\n	                $json = array();\n\n	                $this->cart->clear();\n\n	                $total = 0;\n\n	                 \n\n	                unset($this->session->data[\'vouchers\']);\n\n	                unset($this->session->data[\'shipping_method\']);\n\n	                unset($this->session->data[\'shipping_methods\']);\n\n	                unset($this->session->data[\'payment_method\']);\n\n	                unset($this->session->data[\'payment_methods\']);\n\n	                unset($this->session->data[\'reward\']);\n\n	 \n\n	                $json[\'total\'] = sprintf($this->language->get(\'text_items\'), $this->cart->countProducts() + (isset($this->session->data[\'vouchers\']) ?                           count($this->session->data[\'vouchers\']) : 0), $this->currency->format($total, $this->config->get(\'config_currency\')));\n\n	 \n\n	                if (isset($this->request->get[\'shoppingcart\']) && $this->request->get[\'shoppingcart\']==\'true\') {\n\n	                    $this->response->redirect($this->url->link(\'checkout/cart\'));\n\n	                } else {\n\n	                    $this->response->addHeader(\'Content-Type: application/json\');\n\n	                    $this->response->setOutput(json_encode($json));\n\n	                }\n\n	            }\n\n	            ]]></add>\n\n	        </operation>\n\n	    </file> \n\n	    <file path=\"catalog/controller/checkout/cart.php\">\n\n	        <operation>\n\n	            <search><![CDATA[public function add() {]]></search>\n\n	            <add position=\"before\"><![CDATA[\n\n	            public function clearcart() {\n\n	                $this->load->language(\'checkout/cart\');\n\n	                $json = array();\n\n	                $this->cart->clear();\n\n	                $total = 0;\n\n	                 \n\n	                unset($this->session->data[\'vouchers\']);\n\n	                unset($this->session->data[\'shipping_method\']);\n\n	                unset($this->session->data[\'shipping_methods\']);\n\n	                unset($this->session->data[\'payment_method\']);\n\n	                unset($this->session->data[\'payment_methods\']);\n\n	                unset($this->session->data[\'reward\']);\n\n	 \n\n	                $json[\'total\'] = sprintf($this->language->get(\'text_items\'), $this->cart->countProducts() + (isset($this->session->data[\'vouchers\']) ? count($this->session->data[\'vouchers\']) : 0), $this->currency->format($total, $this->config->get(\'config_currency\')));\n\n	 \n\n	                if (isset($this->request->get[\'shoppingcart\']) && $this->request->get[\'shoppingcart\']==\'true\') {\n\n	                    $this->response->redirect($this->url->link(\'checkout/cart\'));\n\n	                } else {\n\n	                    $this->response->addHeader(\'Content-Type: application/json\');\n\n	                    $this->response->setOutput(json_encode($json));\n\n	                }\n\n	            }\n\n	            ]]></add>\n\n	        </operation>\n\n	    </file>\n\n	 \n\n	    <file path=\"catalog/controller/common/cart.php\">\n\n	        <operation>\n\n	            <search><![CDATA[$this->load->language(\'common/cart\');]]></search>\n\n	            <add position=\"after\"><![CDATA[\n\n	            $data[\'button_clearcart\'] = $this->language->get(\'button_clearcart\');\n            \n			   $data[\'link_clearcart\'] = $this->url->link(\'checkout/cart/clearcart\', \'shoppingcart=true\');\n	            \n				]]></add>\n\n	        </operation>\n\n	    </file>\n\n	   \n\n	    <file path=\"catalog/controller/checkout/cart.php\">\n\n	        <operation>\n\n	            <search><![CDATA[$this->load->language(\'checkout/cart\');]]></search>\n\n	            <add position=\"after\"><![CDATA[\n\n	            $data[\'button_clearcart\'] = $this->language->get(\'button_clearcart\');\n\n	            $data[\'link_clearcart\'] = $this->url->link(\'checkout/cart/clearcart\', \'shoppingcart=true\');\n\n	            ]]></add>\n\n	        </operation>\n\n	    </file>\n\n	   \n\n	    <file path=\"catalog/language/en-gb/common/cart.php\">\n\n	        <operation>\n\n	            <search><![CDATA[$_[\'text_recurring\'] = \'Payment Profile\';]]></search>\n\n	            <add position=\"before\"><![CDATA[\n\n	            $_[\'button_clearcart\']  = \'Clear Cart\';\n\n	            ]]></add>\n\n	        </operation>\n\n	    </file>\n\n	   \n\n	    <file path=\"catalog/language/en-gb/checkout/cart.php\">\n\n	        <operation>\n\n	            <search><![CDATA[$_[\'column_total\']             = \'Total\';]]></search>\n\n	            <add position=\"before\"><![CDATA[\n\n	            $_[\'button_clearcart\']  = \'Clear Cart\';\n\n	            ]]></add>\n\n	        </operation>\n\n	    </file>\n\n	   \n\n	    <file path=\"catalog/view/theme/*/template/checkout/cart.twig\">\n\n	        <operation>\n\n	            <search><![CDATA[{% if modules %}]]></search>\n\n	            <add position=\"before\"><![CDATA[\n\n	                <a href=\"{{ link_clearcart }}\" class=\"btn btn-default\" title=\"{{button_clearcart}}\">{{button_clearcart}}</a>\n\n	            ]]></add>\n\n	        </operation>\n\n	    </file> \n</modification>\n","1","2019-03-14 14:29:26");
